import { ChakraProvider } from "@chakra-ui/react";
import theme from "./theme/theme"

export default function App() {
  return ( <ChakraProvider theme={theme}>
   <div>
     <h1>HellowWorld</h1>
   </div>
  </ChakraProvider>);
}
